	/**
	 * 生成请求报文正式 付款NTIBCOPR
	 * 
	 */
	@SuppressWarnings("unchecked")
	public static String getRequestNTIBCOPRStr(List<BorrowOrder> borrowOrders, HashMap<String, String> params) throws UnsupportedEncodingException {
		java.text.DecimalFormat df = new java.text.DecimalFormat("#.00");

		// 构造支付的请求报文
		XmlPacket xmlPkt = new XmlPacket("AgentRequest", params.get("DF_LGNNAM"));

		Integer sumMoney = 0;

		for (BorrowOrder borrowOrder : borrowOrders) {
			sumMoney += borrowOrder.getIntoMoney();
		}

		Map mpPodInfo = new Properties();
		String yurref = borrowOrders.get(0).getYurref();
		mpPodInfo.put("BUSCOD", params.get("DF_BUSCOD"));// 业务类别
		// mpPodInfo.put("BUSMOD", params.get("DF_BUSMOD"));// 业务模式编号
		mpPodInfo.put("MODALS", params.get("DF_MODALS"));// 业务模式名称
		// if (params.containsKey("DF_MODALS")) {
		// mpPodInfo.put("MODALS", params.get("DF_MODALS"));// 业务模式名称"yq3"
		// } else {
		// mpPodInfo.put("MODALS", "yq3");// 业务模式名称"yq3"
		// }

		mpPodInfo.put("TRSTYP", params.get("DF_TRSTYP"));// 交易代码
		mpPodInfo.put("C_TRSTYP", params.get("DF_C_TRSTYP"));// 交易代码名称

		mpPodInfo.put("DBTACC", params.get("DF_DBTACC"));// 代发为转出账号
		mpPodInfo.put("BBKNBR", params.get("DF_BBKNBR"));// 分行代码 附录A.1
 
		// 打款金额精确到分
		//mpPodInfo.put("SUM", "0.1");// 总金额
		if (yurref != null && yurref.startsWith("H")) {
			mpPodInfo.put("SUM", String.valueOf(sumMoney / 100.0));// 总金额
		} else {
			mpPodInfo.put("SUM", String.valueOf(sumMoney / 100));// 总金额
		}

		mpPodInfo.put("TOTAL", String.valueOf(borrowOrders.size()));// 总笔数
		mpPodInfo.put("CCYNBR", CCYNBR);// 币种代码
		mpPodInfo.put("YURREF", yurref);// 业务参考号
		mpPodInfo.put("MEMO", "代发");// 用途

		xmlPkt.putProperty("SDKATSRQX", mpPodInfo);

		for (BorrowOrder borrowOrder : borrowOrders) {
			Map mpPayInfo = new Properties();
			mpPayInfo.put("ACCNBR", borrowOrder.getCardNo());//
			mpPayInfo.put("CLTNAM", borrowOrder.getRealname());// 户名
			//mpPayInfo.put("TRSAMT", "0.1");// 金额borrowOrder.getIntoMoney()/100
			
			// 打款金额精确到分
			if (yurref != null && yurref.startsWith("H")) {
				mpPayInfo.put("TRSAMT", String.valueOf(borrowOrder.getIntoMoney() / 100.0));// 金额borrowOrder.getIntoMoney()/100
			} else {
				mpPayInfo.put("TRSAMT", String.valueOf(borrowOrder.getIntoMoney() / 100));// 金额borrowOrder.getIntoMoney()/100
			}

			xmlPkt.putProperty("SDKATDRQX", mpPayInfo);
		}
		return xmlPkt.toXmlString();
	}

	/**
	 * 生成请求报文正式 交易查询NTQRYEBP
	 * 
	 */
	@SuppressWarnings("unchecked")
	public static String getRequestNTQRYEBPStr(HashMap<String, String> params) {
		Date nowDate = new Date();
		String beginDate = DateUtil.fyFormatDate(nowDate);
		String endDate = DateUtil.fyFormatDate(DateUtil.addDay(nowDate, 1));
		int nowHour = nowDate.getHours();
		int monute = nowDate.getMinutes();
		if ((nowHour == 0 || nowHour == 23 || nowHour == 12) && monute < 20) {
			beginDate = DateUtil.fyFormatDate(DateUtil.addDay(nowDate, -1));
		}

		// 构造支付的请求报文
		XmlPacket xmlPkt = new XmlPacket("GetAgentInfo", params.get("DF_LGNNAM"));
		Map mpPayInfo = new Properties();

		mpPayInfo.put("BUSCOD", params.get("DF_BUSCOD"));// 网银贷记
		mpPayInfo.put("BGNDAT", beginDate);// 开始时间
		mpPayInfo.put("ENDDAT", endDate);// 结束时间

		xmlPkt.putProperty("SDKATSQYX", mpPayInfo);
		return xmlPkt.toXmlString();
	}

	/*
	 * 连接前置机，发送请求报文，获得返回报文
	 * 
	 * @param data
	 * 
	 * @return
	 * 
	 * @throws MalformedURLException
	 */
	public static String sendRequest(String data, String goUrl) {
		String result = "";
		try {
			URL url;
			url = new URL(goUrl);

			HttpURLConnection conn;
			conn = (HttpURLConnection) url.openConnection();
			conn.setRequestProperty("contentType", "gbk");
			conn.setRequestMethod("POST");
			conn.setDoInput(true);
			conn.setDoOutput(true);
			conn.setReadTimeout(120000);
			conn.setConnectTimeout(120000);
			OutputStream os;
			os = conn.getOutputStream();
			os.write(data.toString().getBytes("gbk"));
			os.close();

			BufferedReader br = new BufferedReader(new InputStreamReader(conn.getInputStream(), "gbk"));
			String line;
			while ((line = br.readLine()) != null) {
				result += line;
			}

			br.close();
		} catch (Exception e) {
			log.error("sendRequest error:{}",e);
			result = "NetworkError CMBDF 代发uk网络连接异常:" + goUrl;
		} finally {
			return result;
		}
	}



	public static ServiceResult processPayResult(String result) {

		ServiceResult serviceResult = new ServiceResult(BorrowOrder.SUB_ERROR, "processPayResult未知异常，请稍后重试！");
		try {

			if (result != null && result.length() > 0) {

				Map params = XmlConvertUtil.xml2Map(result);

				// System.out.println("params:"+params);

				JSONObject INFO = JSONObject.fromObject(params.get("INFO"));
				int RETCOD = INFO.getInt("RETCOD");// 返回代码

				if (RETCOD == 0) {
					serviceResult.setCode(BorrowOrder.SUB_SUBMIT);
					serviceResult.setMsg(INFO.getString("ERRMSG"));
				} else {
					serviceResult.setCode(BorrowOrder.SUB_PAY_FAIL);
					serviceResult.setMsg(INFO.getString("ERRMSG"));
				}

				// System.out.println(serviceResult.getCode() + ">>" +
				// serviceResult.getMsg());
			}

		} catch (Exception e) {
			log.error("processPayResult error:{}",e);
		}
		return serviceResult;
	}

